  1	export interface HealthCheckResult {
  2	  service: string;
  3	  status: 'healthy' | 'degraded' | 'unhealthy';
  4	  latency?: number;
  5	  message?: string;
  6	  details?: Record<string, any>;
  7	  timestamp: number;
  8	}
  9	
 10	export interface SystemHealth {
 11	  overall: 'healthy' | 'degraded' | 'unhealthy';
 12	  checks: HealthCheckResult[];
 13	  timestamp: number;
 14	}
 15	
 16	export class HealthChecker {
 17	  private checks: Map<string, () => Promise<HealthCheckResult>> = new Map();
 18	  private lastResults: Map<string, HealthCheckResult> = new Map();
 19	  private checkInterval: number | null = null;
 20	  private listeners: Set<(health: SystemHealth) => void> = new Set();
 21	
 22	  constructor(
 23	    private intervalMs: number = 30000, // 30 segundos
 24	    private timeoutMs: number = 5000 // 5 segundos timeout por check
 25	  ) {
 26	    this.registerDefaultChecks();
 27	  }
 28	
 29	  private registerDefaultChecks(): void {
 30	    // Browser Performance Check
 31	    this.registerCheck('browser-performance', async () => {
 32	      const start = Date.now();
 33	      try {
 34	        // Simular verificação de performance
 35	        const memoryUsage = performance.memory ? 
 36	          ((performance as any).memory.usedJSHeapSize / (performance as any).memory.jsHeapSizeLimit) * 100 : 
 37	          Math.random() * 100;
 38	        
 39	        const latency = Date.now() - start;
 40	        
 41	        return {
 42	          service: 'browser-performance',
 43	          status: memoryUsage < 80 ? 'healthy' : memoryUsage < 95 ? 'degraded' : 'unhealthy',
 44	          latency,
 45	          message: `Memory usage: ${memoryUsage.toFixed(1)}%`,
 46	          details: {
 47	            memoryPercentage: memoryUsage
 48	          },
 49	          timestamp: Date.now()
 50	        };
 51	      } catch (error) {
 52	        return {
 53	          service: 'browser-performance',
 54	          status: 'unhealthy',
 55	          message: `Error: ${error}`,
 56	          timestamp: Date.now()
 57	        };
 58	      }
 59	    });
 60	
 61	    // Storage Check
 62	    this.registerCheck('storage', async () => {
 63	      try {
 64	        if ('storage' in navigator && 'estimate' in navigator.storage) {
 65	          const estimate = await navigator.storage.estimate();
 66	          const usagePercentage = ((estimate.usage || 0) / (estimate.quota || 1)) * 100;
 67	          
 68	          return {
 69	            service: 'storage',
 70	            status: usagePercentage < 80 ? 'healthy' : usagePercentage < 95 ? 'degraded' : 'unhealthy',
 71	            message: `Storage usage: ${usagePercentage.toFixed(1)}%`,
 72	            details: {
 73	              used: estimate.usage,
 74	              quota: estimate.quota,
 75	              percentage: usagePercentage
 76	            },
 77	            timestamp: Date.now()
 78	          };
 79	        }
 80	        
 81	        return {
 82	          service: 'storage',
 83	          status: 'healthy',
 84	          message: 'Storage API not available',
 85	          timestamp: Date.now()
 86	        };
 87	      } catch (error) {
 88	        return {
 89	          service: 'storage',
 90	          status: 'unhealthy',
 91	          message: `Storage check failed: ${error}`,
 92	          timestamp: Date.now()
 93	        };
 94	      }
 95	    });
 96	
 97	    // Network Check
 98	    this.registerCheck('network', async () => {
 99	      const start = Date.now();
100	      try {
101	        const online = navigator.onLine;
102	        const latency = Date.now() - start;
103	        
104	        if (!online) {
105	          return {
106	            service: 'network',
107	            status: 'unhealthy',
108	            latency,
109	            message: 'No network connection',
110	            timestamp: Date.now()
111	          };
112	        }
113	        
114	        // Simular latência de rede
115	        const networkLatency = Math.random() * 200;
116	        
117	        return {
118	          service: 'network',
119	          status: networkLatency < 100 ? 'healthy' : networkLatency < 300 ? 'degraded' : 'unhealthy',
120	          latency: networkLatency,
121	          message: `Network latency: ${networkLatency.toFixed(0)}ms`,
122	          details: {
123	            online,
124	            effectiveType: (navigator as any).connection?.effectiveType || 'unknown'
125	          },
126	          timestamp: Date.now()
127	        };
128	      } catch (error) {
129	        return {
130	          service: 'network',
131	          status: 'unhealthy',
132	          message: `Network check failed: ${error}`,
133	          timestamp: Date.now()
134	        };
135	      }
136	    });
137	
138	    // Application Health (simulado)
139	    this.registerCheck('application', async () => {
140	      try {
141	        // Simular saúde da aplicação
142	        const errorRate = Math.random() * 0.1; // 0-10% de erro
143	        const responseTime = 50 + Math.random() * 150; // 50-200ms
144	        
145	        const status = errorRate < 0.02 && responseTime < 100 ? 'healthy' :
146	                      errorRate < 0.05 && responseTime < 200 ? 'degraded' : 'unhealthy';
147	        
148	        return {
149	          service: 'application',
150	          status,
151	          latency: responseTime,
152	          message: `Error rate: ${(errorRate * 100).toFixed(1)}%, Response time: ${responseTime.toFixed(0)}ms`,
153	          details: {
154	            errorRate,
155	            responseTime,
156	            uptime: performance.now() / 1000 // segundos desde o carregamento
157	          },
158	          timestamp: Date.now()
159	        };
160	      } catch (error) {
161	        return {
162	          service: 'application',
163	          status: 'unhealthy',
164	          message: `Application check failed: ${error}`,
165	          timestamp: Date.now()
166	        };
167	      }
168	    });
169	  }
170	
171	  registerCheck(service: string, checkFn: () => Promise<HealthCheckResult>): void {
172	    this.checks.set(service, checkFn);
173	  }
174	
175	  async runCheck(service: string): Promise<HealthCheckResult> {
176	    const checkFn = this.checks.get(service);
177	    if (!checkFn) {
178	      return {
179	        service,
180	        status: 'unhealthy',
181	        message: 'Check not found',
182	        timestamp: Date.now()
183	      };
184	    }
185	
186	    try {
187	      const result = await Promise.race([
188	        checkFn(),
189	        new Promise<HealthCheckResult>((_, reject) => 
190	          setTimeout(() => reject(new Error('Timeout')), this.timeoutMs)
191	        )
192	      ]);
193	      
194	      this.lastResults.set(service, result);
195	      return result;
196	    } catch (error) {
197	      const result: HealthCheckResult = {
198	        service,
199	        status: 'unhealthy',
200	        message: `Check failed: ${error}`,
201	        timestamp: Date.now()
202	      };
203	      this.lastResults.set(service, result);
204	      return result;
205	    }
206	  }
207	
208	  async runAllChecks(): Promise<SystemHealth> {
209	    const results = await Promise.all(
210	      Array.from(this.checks.keys()).map(service => this.runCheck(service))
211	    );
212	
213	    const hasUnhealthy = results.some(r => r.status === 'unhealthy');
214	    const hasDegraded = results.some(r => r.status === 'degraded');
215	    
216	    const overall = hasUnhealthy ? 'unhealthy' : hasDegraded ? 'degraded' : 'healthy';
217	
218	    const health: SystemHealth = {
219	      overall,
220	      checks: results,
221	      timestamp: Date.now()
222	    };
223	
224	    // Notificar listeners
225	    this.listeners.forEach(listener => listener(health));
226	
227	    return health;
228	  }
229	
230	  start(): void {
231	    if (this.checkInterval) return;
232	    
233	    // Executar verificação inicial
234	    this.runAllChecks();
235	    
236	    // Configurar intervalo
237	    this.checkInterval = window.setInterval(() => {
238	      this.runAllChecks();
239	    }, this.intervalMs);
240	  }
241	
242	  stop(): void {
243	    if (this.checkInterval) {
244	      clearInterval(this.checkInterval);
245	      this.checkInterval = null;
246	    }
247	  }
248	
249	  onHealthChange(listener: (health: SystemHealth) => void): () => void {
250	    this.listeners.add(listener);
251	    return () => this.listeners.delete(listener);
252	  }
253	
254	  getLastResults(): SystemHealth {
255	    const checks = Array.from(this.lastResults.values());
256	    const hasUnhealthy = checks.some(r => r.status === 'unhealthy');
257	    const hasDegraded = checks.some(r => r.status === 'degraded');
