  1	import { PGlite } from '@electric-sql/pglite';
  2	import { drizzle } from 'drizzle-orm/pglite';
  3	import * as schema from '../shared/schema';
  4	
  5	// Type definitions
  6	export interface EmergencyStore {
  7	  data: Map<string, any>;
  8	  isActive: boolean;
  9	}
 10	
 11	declare global {
 12	  interface Window {
 13	    emergencyStore: EmergencyStore;
 14	    isEmergencyMode: boolean;
 15	    showNotification?: (notification: {
 16	      type: 'info' | 'warning' | 'error' | 'success';
 17	      message: string;
 18	      description?: string;
 19	    }) => void;
 20	  }
 21	}
 22	
 23	class PGliteManager {
 24	  private static instance: PGlite | null = null;
 25	  private static db: ReturnType<typeof drizzle> | null = null;
 26	  private static initPromise: Promise<void> | null = null;
 27	  private static isInitialized = false;
 28	  private static retryCount = 0;
 29	  private static maxRetries = 3;
 30	
 31	  static async initialize(): Promise<void> {
 32	    if (this.initPromise) return this.initPromise;
 33	    
 34	    this.initPromise = this.performInit();
 35	    return this.initPromise;
 36	  }
 37	
 38	  private static async performInit(): Promise<void> {
 39	    try {
 40	      // Check browser support
 41	      if (!window.indexedDB) {
 42	        throw new Error('IndexedDB not supported in this browser');
 43	      }
 44	
 45	      // Check available storage
 46	      const storageAvailable = await this.checkStorageAvailable();
 47	      if (!storageAvailable) {
 48	        throw new Error('Insufficient storage available');
 49	      }
 50	
 51	      console.log('Initializing PGlite...');
 52	
 53	      // Initialize PGlite with optimized settings
 54	      this.instance = new PGlite({
 55	        dataDir: 'idb://app-todos-db',
 56	        relaxedDurability: true, // Better performance for non-critical data
 57	      });
 58	
 59	      // Wait for PGlite to be ready
 60	      await this.instance.waitReady;
 61	
 62	      // Create Drizzle instance
 63	      this.db = drizzle(this.instance, { schema });
 64	
 65	      // Run migrations
 66	      await this.runMigrations();
 67	
 68	      // Mark as initialized
 69	      this.isInitialized = true;
 70	      this.retryCount = 0;
 71	
 72	      console.log('PGlite initialized successfully');
 73	
 74	      // Notify success
 75	      if (window.showNotification) {
 76	        window.showNotification({
 77	          type: 'success',
 78	          message: 'Banco de dados local inicializado',
 79	          description: 'Aplicação pronta para uso offline'
 80	        });
 81	      }
 82	
 83	    } catch (error) {
 84	      console.error('Failed to initialize PGlite:', error);
 85	      
 86	      // Retry logic
 87	      if (this.retryCount < this.maxRetries) {
 88	        this.retryCount++;
 89	        console.log(`Retrying initialization (${this.retryCount}/${this.maxRetries})...`);
 90	        this.initPromise = null;
 91	        
 92	        // Wait before retry with exponential backoff
 93	        await new Promise(resolve => setTimeout(resolve, Math.pow(2, this.retryCount) * 1000));
 94	        
 95	        return this.initialize();
 96	      }
 97	      
 98	      // Activate emergency mode after all retries failed
 99	      await this.activateEmergencyMode();
100	      throw error;
101	    }
102	  }
103	
104	  private static async checkStorageAvailable(): Promise<boolean> {
105	    try {
106	      if ('storage' in navigator && 'estimate' in navigator.storage) {
107	        const { usage, quota } = await navigator.storage.estimate();
108	        const percentUsed = usage! / quota!;
109	        
110	        // Need at least 10% free space
111	        if (percentUsed > 0.9) {
112	          console.warn(`Storage nearly full: ${(percentUsed * 100).toFixed(2)}% used`);
113	          return false;
114	        }
115	      }
116	      return true;
117	    } catch {
118	      // If storage API not available, assume we have space
119	      return true;
120	    }
121	  }
122	
123	  private static async runMigrations(): Promise<void> {
124	    if (!this.instance) throw new Error('PGlite not initialized');
125	    
126	    try {
127	      // Create tables based on schema
128	      await this.instance.exec(`
129	        CREATE TABLE IF NOT EXISTS users (
130	          id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
131	          name TEXT NOT NULL,
132	          email TEXT UNIQUE,
133	          created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
134	          updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
135	          last_sync_at TIMESTAMP,
136	          device_id TEXT
137	        );
138	
139	        CREATE TABLE IF NOT EXISTS issues (
140	          id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
141	          title TEXT NOT NULL,
142	          description TEXT,
143	          status TEXT NOT NULL DEFAULT 'pending',
144	          priority TEXT NOT NULL DEFAULT 'medium',
145	          user_id UUID REFERENCES users(id),
146	          session_id TEXT,
147	          claude_task_id TEXT,
148	          created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
149	          updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
150	          completed_at TIMESTAMP,
151	          version INTEGER DEFAULT 1,
152	          locally_modified BOOLEAN DEFAULT false,
153	          deleted_at TIMESTAMP
154	        );
155	
156	        CREATE TABLE IF NOT EXISTS sync_queue (
157	          id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
158	          table_name TEXT NOT NULL,
159	          record_id UUID NOT NULL,
160	          operation TEXT NOT NULL,
161	          data JSONB NOT NULL,
162	          device_id TEXT NOT NULL,
163	          created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
164	          synced_at TIMESTAMP,
165	          error TEXT,
166	          retries INTEGER DEFAULT 0
167	        );
168	
169	        CREATE TABLE IF NOT EXISTS sync_metrics (
170	          id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
171	          device_id TEXT NOT NULL,
172	          sync_type TEXT NOT NULL,
173	          latency INTEGER,
174	          record_count INTEGER,
175	          bytes_transferred INTEGER,
176	          success BOOLEAN NOT NULL,
177	          error_message TEXT,
178	          created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
179	        );
180	
181	        -- Create indexes for performance
182	        CREATE INDEX IF NOT EXISTS idx_issues_status ON issues(status);
183	        CREATE INDEX IF NOT EXISTS idx_issues_user_id ON issues(user_id);
184	        CREATE INDEX IF NOT EXISTS idx_issues_session_id ON issues(session_id);
185	        CREATE INDEX IF NOT EXISTS idx_issues_updated_at ON issues(updated_at DESC);
186	        CREATE INDEX IF NOT EXISTS idx_sync_queue_synced_at ON sync_queue(synced_at);
187	        CREATE INDEX IF NOT EXISTS idx_sync_metrics_created_at ON sync_metrics(created_at DESC);
188	      `);
189	
190	      console.log('Database migrations completed');
191	    } catch (error) {
192	      console.error('Migration failed:', error);
193	      throw error;
194	    }
195	  }
196	
197	  private static async activateEmergencyMode(): Promise<void> {
198	    console.warn('Activating emergency mode - using in-memory storage');
199	    
200	    // Initialize emergency store
201	    window.emergencyStore = {
202	      data: new Map(),
203	      isActive: true
204	    };
205	    window.isEmergencyMode = true;
206	    
207	    // Notify user
208	    if (window.showNotification) {
209	      window.showNotification({
210	        type: 'warning',
211	        message: 'Modo offline limitado ativado',
212	        description: 'Seus dados serão salvos temporariamente na memória'
213	      });
214	    }
215	    
216	    // Try to recover data from localStorage if available
217	    try {
218	      const savedData = localStorage.getItem('emergency_backup');
219	      if (savedData) {
220	        const parsed = JSON.parse(savedData);
221	        Object.entries(parsed).forEach(([key, value]) => {
222	          window.emergencyStore.data.set(key, value);
223	        });
224	      }
225	    } catch (error) {
226	      console.error('Failed to recover emergency backup:', error);
227	    }
228	    
229	    // Save emergency data periodically
230	    setInterval(() => {
231	      if (window.emergencyStore?.isActive) {
232	        try {
233	          const dataToSave = Object.fromEntries(window.emergencyStore.data);
234	          localStorage.setItem('emergency_backup', JSON.stringify(dataToSave));
235	        } catch (error) {
236	          console.error('Failed to save emergency backup:', error);
237	        }
238	      }
239	    }, 30000); // Every 30 seconds
240	  }
241	
242	  static getDb(): ReturnType<typeof drizzle> {
243	    if (!this.db) {
244	      throw new Error('PGlite not initialized. Call initialize() first.');
245	    }
246	    return this.db;
247	  }
248	
249	  static getInstance(): PGlite {
250	    if (!this.instance) {
251	      throw new Error('PGlite not initialized. Call initialize() first.');
252	    }
253	    return this.instance;
254	  }
255	
256	  static isReady(): boolean {
257	    return this.isInitialized && !window.isEmergencyMode;
258	  }
259	
260	  static isEmergencyMode(): boolean {
261	    return window.isEmergencyMode || false;
262	  }
263	
264	  static async checkHealth(): Promise<{
265	    status: 'healthy' | 'degraded' | 'emergency';
266	    details: any;
267	  }> {
268	    if (window.isEmergencyMode) {
269	      return {
270	        status: 'emergency',
271	        details: {
272	          mode: 'in-memory',
273	          dataSize: window.emergencyStore?.data.size || 0
274	        }
275	      };
276	    }
277	
278	    if (!this.isInitialized) {
279	      return {
280	        status: 'degraded',
281	        details: { reason: 'Not initialized' }
282	      };
283	    }
284	
285	    try {
286	      // Test database connection
287	      const result = await this.instance!.query('SELECT 1');
288	      
289	      return {
290	        status: 'healthy',
291	        details: {
292	          connected: true,
293	          tablesReady: true
294	        }
295	      };
296	    } catch (error) {
297	      return {
298	        status: 'degraded',
299	        details: {
300	          error: error instanceof Error ? error.message : 'Unknown error'
301	        }
302	      };
303	    }
304	  }
305	
306	  static async reset(): Promise<void> {
307	    if (this.instance) {
308	      await this.instance.close();
309	    }
310	    
311	    this.instance = null;
312	    this.db = null;
313	    this.initPromise = null;
314	    this.isInitialized = false;
315	    this.retryCount = 0;
316	    
